import React from 'react';
import './AboutMe.css';

function AboutMe() {
  return (
      <div className="credentials-container">
        <div className="left-column">
        <p><strong>NAME:</strong> Jaskaran Cheema</p>
        <p><strong>PRONOUNS:</strong> He/Him/His</p>
        <p><strong>SCHOOL:</strong> University of California, San Diego</p>
        <p><strong>AGE:</strong> 27 Years</p>
        <p><strong>HOMETOWN:</strong> San Diego, CA</p>

        <div className="social-icons">
          <a href="https://linkedin.com" target="_blank" rel="noreferrer">hh<i className="fa fa-linkedin"></i></a>
          <a href="https://github.com" target="_blank" rel="noreferrer"><i className="fa fa-github"></i></a>
        </div>
      </div>
      <div className="right-column">
        <p>I am a PhD candidate in epidemiology at the University of California, San Diego, with a strong background in public health, epidemiology, and computational modeling. I've worked on several research projects, including Hepatitis C virus modeling and published my findings in reputable journals.</p>
        <p>Outside of my academic life, I have experience teaching undergraduate students, mentoring junior researchers, and developing curriculum for public health courses.</p>
        <button className="download-resume-button">DOWNLOAD RESUME</button>
      </div>
  </div>
  );
}

export default AboutMe;
